import React, { Component } from "react";
import { Link } from 'react-router-dom';
import { withRouter } from 'react-router-dom';
import { connect } from 'unistore/react';
import { actions } from '../store';

class MyCartPage extends Component {
    render() {
        // if ((!this.props.is_login) && (this.props.userStatus !== "pembeli")) {
        //     this.props.history.push('/')
        // }

        return (
            <div class="container my-5">
                <div class="row">
                    <div class='col-12 col-md-8'>
                        <div class="card">
                            <div class="container">
                                <div class="row">
                                    <aside class="col-4 border ">
                                        <article class="gallery-wrap pt-2 text-center">
                                            <img src={require("../images/logo/logo.png")} height="64px" />
                                        </article>
                                    </aside>
                                    <aside class="col-8 border">
                                        <div class="row">
                                            <div class="col-12 border">
                                                <dl class="row pt-2">
                                                    <dd class="col-12">namaProduk asdasdasdasdasd</dd>
                                                    <dd class="col-12">x qty</dd>

                                                    <dt class="col-4">Sub Total </dt>
                                                    <dd class="col-6">totalHarga</dd>

                                                    <dt class="col-2">
                                                        <button href="#" class="btn btn-danger float-right"> <i class="fas fa-trash-alt"></i></button>
                                                    </dt>
                                                </dl>
                                            </div>

                                        </div>

                                    </aside>

                                </div>
                            </div>
                        </div>
                    </div>
                    <div class="col-md-4 col-12">
                        <dl class="row p-2 pt-3">

                            <dt class="col-6">Total Payment</dt>
                            <dd class="col-6">Rp </dd>

                        </dl>
                        <hr />

                    </div>
                </div>
            </div>
        );
    }
}

export default connect('is_login, userStatus', actions)
    (withRouter(MyCartPage));
